class TopHeadlinesMedicalModel {
  TopHeadlinesMedicalModel({
      this.status, 
      this.totalResults, 
      this.articles,});

  TopHeadlinesMedicalModel.fromJson(dynamic json) {
    status = json['status'];
    totalResults = json['totalResults'];
    if (json['articles'] != null) {
      articles = [];
      json['articles'].forEach((v) {
        articles?.add(TopArticles.fromJson(v));
      });
    }
  }
  String? status;
  num? totalResults;
  List<TopArticles>? articles;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = status;
    map['totalResults'] = totalResults;
    if (articles != null) {
      map['articles'] = articles?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}